      "[**3099-5-18**] 7:28 AM\n PHERESIS CATHETER PLMT                                          Clip # [**Clip Number (Radiology) 40097**]\n Reason: CML/THROMBOCYTOPENIA...NEEDS ACCESS FOR LONG TERM PHERESIS\n ********************************* CPT Codes ********************************\n * [**Numeric Identifier 268**] TUNNELED W/O [**Numeric Identifier 2490**] FLUOR GUID PLCT/REPLCT/REMOVE    *\n * C1750 CATH,HEMO/PERTI DIALYSIS LONG                                          *\n ****************************************************************************\n ______________________________________________________________________________\n                                 FINAL REPORT\n INDICATION: Temporary pheresis catheter for conversion to a tunneled pheresis\n catheter.\n\n RADIOLOGIST:  The procedure was performed by Dr. [**First Name4 (NamePattern1) 450**] [**Last Name (NamePattern1) **] and Dr. [**First Name8 (NamePattern2) 413**]\n [**Name (STitle) 6**].  The attending physician, [**Last Name (NamePattern4) **]. [**Last Name (STitle) 6**], was present and supervising\n throughout the procedure.\n\n CONSENT:  After the risks and benefits of the procedure were discussed with\n the patient, a written informed consent was obtained.\n\n PROCEDURE/FINDINGS:  The left neck and upper chest, including the external\n portion of the patient's temporary pheresis catheter, were prepped and draped\n in a standard sterile fashion.  The selected entry site for the subcutaneous\n tunnel tract was anesthetized with 1% lidocaine.  The tunnel entry site was\n incised with a scalpel.  A 14.5-French, 23 cm cuff-to-tip dual lumen pheresis\n catheter was advanced through the tunnel tract with the help of a tunneler,\n exiting at the venous access site in the lower left neck overlying the left\n internal jugular vein.  The patient's temporary pheresis catheter was flushed.\n [**Initials (NamePattern4) **] [**Last Name (NamePattern4) 7**] wire was advanced through the catheter into the IVC under fluoroscopic\n guidance.  The catheter was exchanged for a peel-away sheath.  The new\n tunneled catheter was advanced through the sheath into the SVC under\n fluoroscopic guidance.  The sheath was removed.  The catheter was flushed and\n capped with extension tubing.  Its hub was sutured to the skin with 0-silk\n sutures.  The venous access site in the upper neck was closed with 2-0 Vicryl\n sutures.  The catheter was hep-locked.  It is ready for use.\n\n A final fluoroscopic chest radiograph was obtained, demonstrating the pheresis\n catheter tip at the junction of the SVC and the right atrium.  There is also a\n right subclavian Port-A-Cath with tip in the right atrium.\n\n COMPLICATIONS:  No immediate complications.\n\n MEDICATIONS:  The patient was premedicated with Xanax po and Dilaudid im.\n During the procedure, Fentanyl iv and Versed iv were administered by a\n registered nurse who was monitoring the patient throughout. Please refer to\n the nursing record for medications dosages. 15 cc of 1% lidocaine sc was also\n administered during the procedure.\n\n IMPRESSION:  Successful conversion of a temporary pheresis catheter to a\n tunneled pheresis catheter, with tip at the junction of the SVC and the right\n atrium. The catheter is ready for use.\n\n\n                                                                       DFDkq\n                                                             (Over)\n\n [**3099-5-18**] 7:28 AM\n PHERESIS CATHETER PLMT                                          Clip # [**Clip Number (Radiology) 40097**]\n Reason: CML/THROMBOCYTOPENIA...NEEDS ACCESS FOR LONG TERM PHERESIS\n ______________________________________________________________________________\n                                 FINAL REPORT\n (Cont)\n\n\n",
