      '[**3099-11-6**] 5:20 PM\n CT CHEST W/O CONTRAST                                           Clip # [**Clip Number (Radiology) 40099**]\n Reason: please eval lung fields\n Admitting Diagnosis: FEVER;R/O PULMONARY INFECTION\n Field of view: 36\n ______________________________________________________________________________\n UNDERLYING MEDICAL CONDITION:\n    40 year old man with hx of bronchiolitis obliterans, graft vs host disease\n  s/p  BMT for CML... acute dyspnea/fevers\n REASON FOR THIS EXAMINATION:\n  please eval lung fields\n CONTRAINDICATIONS for IV CONTRAST:\n  elevated Cr\n ______________________________________________________________________________\n                                 FINAL REPORT\n INDICATION:  40-year-old male with history of bronchiolitis obliterans and\n graft versus host disease with dyspnea and fevers.\n\n TECHNIQUE:  Axial non-contrast CT imaging of the chest.  Comparison made to\n prior chest CTs from [**3099-5-11**] and [**3099-10-12**].\n\n FINDINGS:  Two central venous lines terminate within the lower SVC.  The\n heart, pericardium, great vessels are within normal limits.  There is a tiny\n pericardial effusion that is decreased in size when compared to [**3099-10-12**]. No\n pathologically enlarged axillary, hilar, or mediastinal lymph nodes are\n identified on this study limited by lack of IV contrast.  No pneumothorax is\n seen.\n\n A tiny left pleural effusion is unchanged.\n\n Within the right lung apex, a pulmonary nodule measuring approximately 9 mm in\n greatest dimension is unchanged in size and configuration when compared to\n prior studies dating back to [**3099-5-11**].  No new pulmonary nodules are seen.\n Areas of pleural thickening along the lateral aspects of the major fissures\n bilaterally are unchanged.  Areas of small ground-glass opacity within the\n left lower lobe (series 3, image 31), the right middle lobe (series 3, image\n 35), as well as within the right lower lobe are unchanged.  No new areas of\n opacity are seen.\n\n Within the visualized portion of the upper abdomen, limited views of the\n kidneys, spleen, pancreas, gallbladder, liver, and adrenal glands are\n unremarkable on this study limited by the lack of IV contrast.  No suspicious\n lytic or sclerotic bone lesions are seen.\n\n IMPRESSION:\n\n No change within the lungs compared to [**3099-10-12**].\n\n A tiny pericardial effusion has decreased in size and a left-sided pleural\n effusion is unchanged.\n\n A right apical pulmonary nodule as well as areas of focal ground glass opacity\n within both lungs appear stable.\n                                                             (Over)\n\n [**3099-11-6**] 5:20 PM\n CT CHEST W/O CONTRAST                                           Clip # [**Clip Number (Radiology) 40099**]\n Reason: please eval lung fields\n Admitting Diagnosis: FEVER;R/O PULMONARY INFECTION\n Field of view: 36\n ______________________________________________________________________________\n                                 FINAL REPORT\n (Cont)\n\n\n\n\n\n\n\n\n\n\n\n',
