      '[**3099-11-20**] 10:51 AM\n PHERESIS CATHETER REMOVAL                                       Clip # [**Clip Number (Radiology) 40100**]\n Reason: Patient needs REMOVAL of tunnelled pheresis catheter.  To be\n ICD9 code from order: 205.1\n ********************************* CPT Codes ********************************\n * [**Numeric Identifier 2629**] TUNNELED CENTRAL W/O PORT                                              *\n ****************************************************************************\n ______________________________________________________________________________\n UNDERLYING MEDICAL CONDITION:\n  41 year old man with CML.\n REASON FOR THIS EXAMINATION:\n  Patient needs REMOVAL of tunnelled pheresis catheter.  To be in pheresis unit @\n  10am.  Platelets to be given if platelets less than 80,000 in pheresis unit.\n  Will call interventional radiology when patient arrives.\n ______________________________________________________________________________\n                                 FINAL REPORT\n HISTORY:  41-year-old man with CML and graft versus host disease.  Needs\n removal of tunneled pheresis catheter.  The patient has a 14.5-French left\n internal jugular vein tunneled catheter in place.\n\n RADIOLOGISTS:  [**Last Name (NamePattern4) 740**] [**Last Name (NamePattern4) 2597**] and [**Doctor Last Name 6**], with Dr. [**Last Name (STitle) 6**], the Attending\n Radiologist, being present and supervising.\n\n The patient was positioned supine on a stretcher with head of bed elevated.\n Standard sterile prep and drape of the left base of the neck and upper chest\n and in situ catheter.  The retaining sutures were cut.  Local anesthesia with\n 6 cc of 1% lidocaine with epinephrine.  Using blunt dissection the retaining\n cuff of the catheter was freed from the subcutaneous tunnel.  The catheter was\n removed and hemostasis was ensured with direct manual compression at the base\n of the neck internal jugular vein puncture site.  A sterile dressing was\n applied over the tunnel entry site.  The patient was instructed to keep the\n head of bed elevated and/or to sit upright as much as possible today.  He is\n instructed not shower for 24 hours and then to cover the tunnel site as he\n would when the catheter was in place.  He was told not to submerse the area of\n the tunnel site for at least two weeks.\n\n IMPRESSION:  Successful removal of a left internal jugular vein tunneled 14.5-\n French double-lumen central venous catheter.  The catheter was examined and it\n was removed in its entirety.\n\n\n',
