      '[**3100-2-18**] 3:47 PM\n CHEST (PA & LAT)                                                Clip # [**Clip Number (Radiology) 40101**]\n Reason: assess for infiltrate\n ______________________________________________________________________________\n UNDERLYING MEDICAL CONDITION:\n  41 year old man with s/p bmt , gvhd w/ decreased spo2\n REASON FOR THIS EXAMINATION:\n  assess for infiltrate\n ______________________________________________________________________________\n                                 FINAL REPORT\n INDICATION:  41-year-old man with status post BMT, GVHD, now decreased pulse\n decreased SPO2.\n\n COMPARISON:  [**3099-11-6**], and CT chest of [**3099-11-6**].\n\n PA AND LATERAL CHEST RADIOGRAPH:  There is a right-sided subclavian Port-A-\n Cath device terminating in the cavoatrial junction.  The heart size and\n mediastinal contours are within normal limits.  Pulmonary vasculature is\n normal.  There has been increased in the size of a small left pleural\n effusion. Otherwise, the lung fields are grossly clear.  The osseous\n structures are unremarkable.\n\n IMPRESSION:\n 1.  Small left pleural effusion, slightly increased in size compared to the\n prior examination.\n 2.  Small right pulmonary nodule seen on CT is not well seen on this study.\n The CT of [**3099-11-6**], should be referred to for further details.\n\n\n',
