      "[**3100-2-19**] 12:51 PM\n CT CHEST W/O CONTRAST                                           Clip # [**Clip Number (Radiology) 40103**]\n Reason: EVAL FOR SOURCE OF INFECTION, FEVER/ CHILLS H/O BOOP\n Admitting Diagnosis: FEVER\n ______________________________________________________________________________\n UNDERLYING MEDICAL CONDITION:\n  41 year old man with h/o BOOP now with fever/chills to 103.7\n REASON FOR THIS EXAMINATION:\n  ?reason for fevers\n No contraindications for IV contrast\n ______________________________________________________________________________\n                                 FINAL REPORT\n CT CHEST [**3100-2-19**]:\n\n COMPARISON: [**3099-11-6**].\n\n INDICATION:  Fever and chills.  Question infection.  History of COPD.\n\n COMPARISON:  [**3099-11-6**]  chest CT.\n\n Multidetector CT of the chest was performed without intravenous or oral\n contrast administration.  A series of high-resolution CT images were\n retrospectively reconstructed from the axial dataset.  Additionally, three\n selected expiratory high resolution images were performed at end expiration.\n The continuous datasets from the end inspiratory sequence was also used to\n create a series of multiplanar reformation images which are reviewed in\n conjunction with the axial images.\n\n There are band-like, linear areas of opacity in both lower lobes and in the\n lingula.  No confluent areas of consolidation are seen in either lung to\n suggest the presence of pneumonia.  A linearly oriented nodular opacity at the\n right apex (image 93, series 3 is without interval change.  At a similar level\n anteriorly, there is stable appearance of linear scar at the right apex.\n\n Three selected expiratory high-resolution CT images demonstrate mild to\n moderate air trapping.\n\n Soft tissue structures demonstrate bilateral pleural effusions, small to\n moderate on the left and small on the right.  The right pleural effusion is\n essentially new in the interval and the left pleural effusion has increased in\n size.  Both effusions are predominantly dependent in location, although there\n are small non-dependent component to the left pleural effusion anteriorly,\n laterally and in the major fissure.  The heart size is normal.  A small\n pericardial effusion is again demonstrated.  Coronary artery calcifications\n are noted.  Surgical chain sutures are noted in the right lung.\n\n Within the imaged portion of the upper abdomen, the adrenal glands are normal.\n\n Skeletal structures demonstrate no suspicious lytic or blastic skeletal\n lesions.\n\n IMPRESSION:\n\n                                                             (Over)\n\n [**3100-2-19**] 12:51 PM\n CT CHEST W/O CONTRAST                                           Clip # [**Clip Number (Radiology) 40103**]\n Reason: EVAL FOR SOURCE OF INFECTION, FEVER/ CHILLS H/O BOOP\n Admitting Diagnosis: FEVER\n ______________________________________________________________________________\n                                 FINAL REPORT\n (Cont)\n 1)  Interval increase in size of left pleural effusion and development of a\n new right pleural effusion.\n\n 2)  No findings to suggest the presence of pneumonia.\n\n 3)  Persistent small pericardial effusion.\n\n 4)  Mild to moderate expiratory air trapping, which may relate to the\n patient's history of chronic graft vs. host disease.\n\n 5)  Small linearly oriented right apical nodular opacity unchanged (image 97),\n possibly due to nodular scarring, but attention to this area on follow up CT\n in 6 months may be helpful to document continued stability.\n\n\n",
