      '[**3101-1-31**] 10:14 AM\n PICC LINE PLACMENT SCH                                          Clip # [**Clip Number (Radiology) 39536**]\n Reason: currently has no access, needs iv antibiotics. do not use ri\n Admitting Diagnosis: SHORTNESS OF BREATH\n ********************************* CPT Codes ********************************\n * [**Numeric Identifier 447**] PICC W/O [**Numeric Identifier 448**] FLUORO GUID PLCT/REPLCT/REMOVE   *\n * [**Numeric Identifier 270**] US GUID FOR VAS. ACCESS                                                *\n ****************************************************************************\n ______________________________________________________________________________\n UNDERLYING MEDICAL CONDITION:\n  42 year old man with CML s/p allo [**3095**] with pneumonia and a-flutter\n REASON FOR THIS EXAMINATION:\n  currently has no access, needs iv antibiotics. do not use right arm, has right\n  sided SVC clot.\n ______________________________________________________________________________\n                                 FINAL REPORT\n HISTORY:  43-year-old man with CML, status post bone marrow transplant,\n presenting with pneumonia and atrial flutter.\n\n RADIOLOGISTS:  This procedure was performed by Dr. [**First Name (STitle) 766**] [**Name (STitle) 191**].\n\n TECHNIQUE:  The patient was placed supine on the angiography table.  The left\n upper arm was prepared in the standard sterile fashion.  Ultrasound was used\n to localize a patent vein.  The left basilic vein was not visualized.  The\n left brachial vein presented patent and compressible.  After local anesthesia\n with 3 mL of lidocaine 1%, access was gained to the left brachial vein with a\n 21-gauge needle, under ultrasound guidance.  Hard copies of ultrasound images\n before and after establishing access were obtained to document vein patency.\n A 0.018 guidewire was advanced through the needle into the brachial vein.  The\n needle was then exchanged for a 5-French peel-away sheath.  The needle was\n further advanced into the superior vena cava, under fluoroscopic guidance.\n Based on the markers on the guidewire, it was determined that a length of 48\n cm would be suitable.  The PICC line was trimmed to this length and advanced\n over the wire under fluoroscopic guidance.  The wire was removed.  The\n catheter was flushed.  The catheter was secured to the skin with a StatLock,\n and the dressing was applied.\n\n COMPLICATIONS:  There were no immediate complications.\n\n IMPRESSION:  Successful placement of a double-lumen PICC line through the left\n brachial vein with tip in the superior vena cava.  The catheter is ready for\n use.\n\n\n\n',
