      '[**3101-2-16**] 2:47 PM\n CT CHEST W/O CONTRAST                                           Clip # [**Clip Number (Radiology) 39596**]\n Reason: Please evaluate pna for interval change.  NO IV CONTRAST PLE\n Admitting Diagnosis: SHORTNESS OF BREATH\n ______________________________________________________________________________\n UNDERLYING MEDICAL CONDITION:\n      42 year old man with h/o BMT, h/o BOOP, h/o RUE DVT, recent influenza and\n  pneumonia.\n REASON FOR THIS EXAMINATION:\n  Please evaluate pna for interval change.  NO IV CONTRAST PLEASE\n CONTRAINDICATIONS for IV CONTRAST:\n  h/o renal insufficiency, no contrast please.\n ______________________________________________________________________________\n                                 FINAL REPORT\n INDICATION:  Patient with history of bone marrow transplant, bronchiolitis\n obliterans, and right upper extremity DVT with recent pneumonia and influenza.\n Evaluate for change.\n\n COMPARISON:  CTA of the chest of [**3101-2-7**].\n\n TECHNIQUE:  Contiguous axial images through the chest were obtained without IV\n contrast.  Coronal reformatted images were generated.\n\n CT OF THE CHEST WITHOUT CONTRAST:  There is a left subclavian central venous\n catheter in place, with the tip in the SVC.  There is a moderate right and a\n small left pleural effusion, slightly decreased compared to the prior study.\n Consolidation with air bronchograms are again seen in both lower lobes.  The\n amount of consolidation is not significantly changed in the interim.\n Peribronchovascular opacities within the right middle lobe are not\n significantly changed.  Tiny nodular opacities within the lingula are slightly\n more prominent compared to the prior exam.  The central airways are patent to\n the level of the segmental bronchi bilaterally.\n\n Calcifications of the right pleura are again noted.  A small pericardial\n effusion is unchanged.  There are no pathologically enlarged axillary,\n mediastinal, or hilar nodes.\n\n The examination was not tailored for evaluation of the abdominal structures,\n but the imaged portions of the non-contrast enhanced liver and adrenal glands\n are unremarkable.\n\n BONE WINDOWS:  There are no suspicious osteolytic or sclerotic lesions.\n\n Coronal reformatted images were helpful in delineating the anatomy and\n pathology in this case.\n\n IMPRESSION:\n\n 1.  No significant short interval change in the appearance of the chest, with\n bilateral lower lobe consolidations, to a similar degree.  Opacities of the\n right middle lobe and lingula as well as the portion of the right upper lobe\n appear similar, with possible slight increase in nodular opacities in the\n lingula.\n                                                             (Over)\n\n [**3101-2-16**] 2:47 PM\n CT CHEST W/O CONTRAST                                           Clip # [**Clip Number (Radiology) 39596**]\n Reason: Please evaluate pna for interval change.  NO IV CONTRAST PLE\n Admitting Diagnosis: SHORTNESS OF BREATH\n ______________________________________________________________________________\n                                 FINAL REPORT\n (Cont)\n 2.  Moderate right pleural effusion and small left pleural effusion are\n slightly decreased from the prior study.\n 3.  Small unchanged pericardial effusion.\n 4.  Coronary artery calcifications.\n 5.  Right pleural calcifications.\n\n\n',
