      "[**3101-7-16**] 1:35 AM\n CT SINUS/MANDIBLE/MAXILLOFACIAL W/O CONTRAST                    Clip # [**Clip Number (Radiology) 39600**]\n Reason: SPINDLE CELL CA OF LEFT CHEEK\n ______________________________________________________________________________\n UNDERLYING MEDICAL CONDITION:\n  42 year old man with hx CMP s/p bone marrow transplant with new diagnosis of\n  spindle cell cancer of the left cheek.\n REASON FOR THIS EXAMINATION:\n  Please evaluate the area of the left cheek, where a spindle cell cancer is\n  present.  We are interested in the extent of the mass and also if there is an\n  abscess present.\n CONTRAINDICATIONS for IV CONTRAST:\n  DIFFICULT STICK AND GVHD\n ______________________________________________________________________________\n WET READ: AHPb TUE [**3101-7-16**] 2:55 AM\n  dermal thickening and soft tissue stranding in the subcutaneous tissues of the\n  right face extending from the inferior eyelid (no post-septal extension)\n  inferiorly to a level even with the maxillary dental row.  no lytic osseous\n  extension.  stranding abuts the masseter and involvement cannot be definitely\n  excluded, but the architecture of the muscle is normal and likely uninvolved.\n ______________________________________________________________________________\n                                 FINAL REPORT\n INDICATION:  Status post bone marrow transplant with new diagnosis of spindle\n cell cancer of the left cheek.  Otolaryngology consult by Dr. [**Last Name (STitle) 39601**]\n describes right cheek mass.\n\n TECHNIQUE:  Multidetector CT imaging of the facial bones was displayed in 1.25\n and 2.5 axial collimation.  Intravenous contrast was not administered\n secondary to patient preference.  Coronal reformatted images were also\n obtained.\n\n FINDINGS:  Comparison is made to a prior CT of the sinuses from [**3100-2-19**]. There\n is thickening of the dermis and subcutaneous stranding along the right face\n extending from the inferior margin of the right eye to the right cheek at the\n level of the maxillary dental row. The right inferior eyelid is thickened, but\n there is no evidence for post- septal involvement. The soft tissue density\n is abutting right masseter and the right zygomaticus, with obscuration of\n the adjacent fat planes, but muscle architecture is normal. Involvement of\n these muscles cannot definitively be excluded. The right Stensen's duct\n appears asymmetrically enlarged, and involvement by tumor cannot be excluded.\n There is no osseous erosion. No suspicious lesions are identified. The\n visualized paranasal sinuses are clear. A few of the left mastoid air cells\n are opacified.  No abnormality of the nasopharynx is seen.\n\n The exact margins of the tumor are difficult to evaluate, but the subcutaneous\n soft tissue stranding extends 11 cm in craniocaudal dimension.\n\n There is minimal soft tissue stranding of the subcutaneous fat of the left\n cheek.\n\n Fatty atrophy of the submandibular glands are seen bilaterally.\n\n Cataract surgical changes of the globes are seen bilaterally.\n                                                             (Over)\n\n [**3101-7-16**] 1:35 AM\n CT SINUS/MANDIBLE/MAXILLOFACIAL W/O CONTRAST                    Clip # [**Clip Number (Radiology) 39600**]\n Reason: SPINDLE CELL CA OF LEFT CHEEK\n ______________________________________________________________________________\n                                 FINAL REPORT\n (Cont)\n\n Minimal degenerative change of the right TMJ is noted.  There are\n degenerative changes of the visualized upper cervical spine with moderate to\n severe left foraminal stenoses at C2/3 and C3/4.\n\n IMPRESSION:  Dermal thickening and subcutaneous stranding of the right face as\n described above, consistent with history of right cheek mass.  Evaluation is\n limited without intravenous contrast.\n\n\n",
