      '[**3101-10-14**] 11:26 AM\n PICC LINE PLACMENT SCH                                          Clip # [**Clip Number (Radiology) 39603**]\n Reason: Needs on [**3101-10-14**] in AM. Dispo pending this PICC line. IV nu\n Admitting Diagnosis: CML\n ********************************* CPT Codes ********************************\n * [**Numeric Identifier 447**] PICC W/O [**Numeric Identifier 448**] FLUORO GUID PLCT/REPLCT/REMOVE   *\n * [**Numeric Identifier 270**] US GUID FOR VAS. ACCESS                                                *\n ****************************************************************************\n ______________________________________________________________________________\n UNDERLYING MEDICAL CONDITION:\n  42 year old man with CML 5.5 years s/p allo stem cell transplant, extensive\n  GVHD, R cheek sarcoma here with pneumococcal bacteremia requiring PICC for 2\n  week IV vancomycin. Surveillance cultures since [**10-9**] have been negative.\n REASON FOR THIS EXAMINATION:\n  Needs on [**3101-10-14**] in AM. Dispo pending this PICC line. IV nurse unable to place\n  (note in chart)\n ______________________________________________________________________________\n                                 FINAL REPORT\n PICC LINE PLACEMENT\n\n INDICATION: IV access needed for antibiotics .\n\n The procedure was explained to the patient. A timeout was performed.\n\n RADIOLOGIST: Drs. [**Last Name (STitle) 2339**], [**Name5 (PTitle) 188**] and [**Doctor Last Name 181**], the attending\n radiologist, performed the procedure.\n\n TECHNIQUE: Using sterile technique and local anesthesia, the left basilic vein\n was punctured under direct ultrasound guidance using a micropuncture set. Hard\n copies of ultrasound images were obtained before and immediately after\n establishing intravenous access. A peel-away sheath was then placed over a\n guidewire and a single-lumen [**Last Name (un) 2652**] PICC line measuring 51 cm in length was\n then placed through the peel-away sheath with its tip positioned in the SVC\n under fluoroscopic guidance. Position of the catheter was confirmed by a\n fluoroscopic spot film of the chest.\n\n The peel-away sheath and guidewire were then removed. The catheter was secured\n to the skin, flushed, and a sterile dressing applied.\n\n The patient tolerated the procedure well. There were no immediate\n complications.\n\n IMPRESSION: Uncomplicated ultrasound and fluoroscopically guided 4 French\n single-lumen [**Last Name (un) 2652**] PICC line placement via the left basilic venous\n approach. Final internal length is 51 cm, with the tip positioned in SVC. The\n line is ready to use.\n\n\n\n',
