      '[**3101-10-16**] 10:48 AM\n PICC LINE PLACMENT SCH                                          Clip # [**Clip Number (Radiology) 39604**]\n Reason: Leak in catheter. Pulled by home IV nurse. Needs new single\n ********************************* CPT Codes ********************************\n * [**Numeric Identifier 447**] PICC W/O [**Numeric Identifier 448**] FLUORO GUID PLCT/REPLCT/REMOVE   *\n * [**Numeric Identifier 270**] US GUID FOR VAS. ACCESS                                                *\n ****************************************************************************\n ______________________________________________________________________________\n UNDERLYING MEDICAL CONDITION:\n  42 year old man with history of AML, pneunomia on IV Ceftriaxone.\n REASON FOR THIS EXAMINATION:\n  Leak in catheter. Pulled by home IV nurse. Needs new single lumen [**Last Name (un) **]\n  PICC.  Patient cannot receive heparin.\n ______________________________________________________________________________\n                                 FINAL REPORT\n HISTORY:  43-year-old man with AML and pneumonia on IV antibiotics.\n\n RADIOLOGISTS:  This procedure was performed by Dr. [**First Name (STitle) 766**] [**Name (STitle) 191**].\n\n The patient was placed supine on the fluoroscopy table.  The left upper arm\n was prepped and draped in a standard sterile fashion.  After local anesthesia\n with 5 ml of Lidocaine 1%, access was gained into the left basilic vein with a\n 21 gauge needle, under ultrasound guidance.  Hard copies of ultrasound images\n before and after establishing venous access were obtained.  A 5 French\n peel-away sheath was advanced over the wire.  A single lumen [**Last Name (un) 2652**] PICC\n line with a total length of 53 cm was then advanced through the peel-away\n sheath, under fluoroscopic guidance with tip in the superior vena cava.  A\n final chest x-ray image was obtained to confirm catheter position.  The\n catheter was secured to the skin and the dressing was applied.\n\n COMPLICATIONS:  There were no immediate complications.\n\n IMPRESSION:  Successful placement of a single lumen [**Last Name (un) 2652**] PICC line with 53\n cm in length with tip in the superior vena cava.  The catheter is ready for\n use.\n\n\n\n',
