      '[**3102-2-1**] 8:42 AM\n MRI SOFT TISUUE NECK, W/O CONTRAST                              Clip # [**Clip Number (Radiology) 39605**]\n Reason: post surgical and radiation scan for assessment and baseline\n ______________________________________________________________________________\n UNDERLYING MEDICAL CONDITION:\n  42 year old man with resected high grade sarcoma of right cheek with graft.\n REASON FOR THIS EXAMINATION:\n  post surgical and radiation scan for assessment and baseline\n No contraindications for IV contrast\n ______________________________________________________________________________\n                                 FINAL REPORT\n INDICATION:  History  of high-grade sarcoma of the right cheek, status post\n resection and graft reconstruction.\n\n COMPARISON:  [**3101-9-11**].\n\n TECHNIQUE:  Axial and coronal T1-weighted, axial fat-suppressed T2-weighted,\n and multiplanar STIR images of the neck were obtained.\n\n The patient declined intravenous contrast.\n\n FINDINGS:  Evaluation for recurrent tumor is limited by the absence of\n intravenous contrast.  The right cheek graft appears unchanged. Persistent\n high T2 signal in the right retroantral fat likely represents sequela of\n surgery. The right masseter muscle has decreased in bulk compared to [**3101-9-11**]\n with high T2 signal, suggestive of denervation atrophy. There is new high T2\n signal in the right parotid gland, which may represent post-radiation\n parotitis. Mastoid air cells are partially opacified bilaterally.\n\n There is low signal on T1-weighted images and high signal on T2-weighted\n images opacifying both maxillary sinuses, both ethmoid sinuses, the left\n sphenoid sinus, and the upper right nasal cavity.  These findings are new\n compared to [**3101-9-11**].\n\n IMPRESSION:\n 1)  Evaluation for recurrent tumor is limited in the absence of intravenous\n contrast.\n 2)  Stable appearance of the right cheek graft and post-surgical changes in\n the right retroantral fat.\n 3) New loss of bulk and signal abnormality in the right masseter muscle,\n likely representing denervation atrophy.\n 4)  New signal abnormality in the right parotid gland, which may represent\n post-radiation parotitis.\n\n 5) Opacification of the paranasal sinuses and the right upper nasal cavity, as\n described above.  Partial opacification of bilateral mastoid air cells.\n\n                                                                       DFDkq\n\n\n',
