      "[**3103-12-9**] 8:16 PM\n MR HEAD W & W/O CONTRAST; MRA BRAIN W/O CONTRAST                Clip # [**Clip Number (Radiology) 39687**]\n Reason: Please perform with MRI w/ contrast\n Admitting Diagnosis: ALTERED MENTAL STATUS\n  Contrast: MAGNEVIST Amt: 13\n ______________________________________________________________________________\n UNDERLYING MEDICAL CONDITION:\n  45 year old man with h.o. CML s/p allogenic trnasplant, chronic GVHD,\n  bronchiolitis obliterans s/p recent d/c for PNA p/w altered mental status. CT\n  scan shows 6 mm hyperdense focus in the left temporal lobe\n REASON FOR THIS EXAMINATION:\n  Please perform with MRI w/ contrast\n No contraindications for IV contrast\n ______________________________________________________________________________\n PROVISIONAL FINDINGS IMPRESSION (PFI): [**First Name9 (NamePattern2) 24873**] [**First Name8 (NamePattern2) 37**] [**3103-12-10**] 10:22 AM\n  PFI:\n\n  1.  Heterogeneous signal and enhancement with associated mass effect within\n  the right frontotemporal lobe, similar to that seen on the recent CT scan and\n  outside neck MRI.  This finding may reflect post-radiation change, though the\n  possibility for superimposed infection, metastatic disease or even a\n  graft-versus-host disease cannot be excluded.\n\n  2.  Punctate subacute hemorrhage within the posterior aspect of the left\n  superior temporal gyrus associated with additional areas of hemosiderin\n  staining throughout the subarachnoid space bilaterally with no hydrocephalus.\n\n  3.  Extensive maxillary sinus disease bilaterally with air-fluid levels as\n  well as partial visualization of the post-surgical changes within the right\n  face.\n\n  4.  Normal MRA without vascular malformation, aneurysm or significant\n  vasospasm.\n ______________________________________________________________________________\n                                 FINAL REPORT\n EXAMINATION:  Brain MRI/MRA.\n\n HISTORY:  45-year-old male with CML and bronchiolitis obliterans presents\n status post recent pneumonia with altered mental status.\n Additional h/o sarcoma of the right side of face treated with external beam\n radiation.\n\n COMPARISON:  Brain MRI, [**3096-12-27**] and head CT, [**3103-12-8**].\n\n FINDINGS:  There is heterogeneous T1 and T2 signal throughout the right\n frontoparietal lobes associated with irregular enhancement and sulcal\n effacement.  Multiple scattered foci of negative susceptibility are noted,\n some of which are in the cortex and others in the adjacent sulci and\n correspond to the foci of calcifications seen on recent CT Head study. There\n is mild surrounding edema.  The lesion is partially seen on prior MR Neck of\n [**3103-5-18**]. This can relate to prior radiation changes, neoplasm related to\n radiation induced change, underlying conditions of CML/ known sarcoma of the\n face.\n                                                             (Over)\n\n [**3103-12-9**] 8:16 PM\n MR HEAD W & W/O CONTRAST; MRA BRAIN W/O CONTRAST                Clip # [**Clip Number (Radiology) 39687**]\n Reason: Please perform with MRI w/ contrast\n Admitting Diagnosis: ALTERED MENTAL STATUS\n  Contrast: MAGNEVIST Amt: 13\n ______________________________________________________________________________\n                                 FINAL REPORT\n (Cont)\n\n  There is no acute infarct.\n\n There is a 5-mm focus of susceptibility artifact and T1 shortening within the\n posterior aspect of the left superior temporal gyrus, correlating with the\n hyperdensity seen on the preceding CT scan.\n Partially seen are reconstructive changes of the right base following\n management of patient's facial sarcoma.  There is extensive nodular\n mucoperiosteal thickening throughout the maxillary sinuses with air-fluid\n levels present.  There is fluid within the bilateral mastoid air cells, as\n well as within the posterior nasopharynx, which may relate to intubation.\n\n MRA:  The intracranial internal carotid arteries are normal.  The middle and\n anterior cerebral arteries are normal.  There is a triangular outpouching\n arising from the left M1 segment, which appears to give rise to a small branch\n vessel and this is thought to represent an infundibulum rather than an\n aneurysm.  There is mild fullness of the anterior communicating artery without\n a discrete aneurysm.  There is left vertebral artery dominance with a tiny\n right vertebral artery.  The posterior cerebral arteries are patent\n bilaterally with persistent fetal contribution to formation of the left\n posterior cerebral artery.\n\n IMPRESSION:\n\n 1.  Heterogeneous signal and enhancement with associated mass effect within\n the right frontotemporal lobe -partly characterized  on the recent CT scan and\n outside neck MRI from [**Month (only) 3112**].  While the above findings could reflect\n post-radiation change as previously suggested, consideration should be given\n to the possibility for radiation induced neoplasm, related to CML/sarcoma of\n the face/denovo or even graft-versus-host disease.  Further characterization\n is suggested, which could take the form of a Thallium/PET scan and/or biopsy.\n Infection is less likely given it's identification on MR Neck done about 6\n months earlier.\n\n 2.  Punctate subacute hemorrhage within the posterior aspect of the left\n superior temporal gyrus associated with additional areas of hemosiderin\n staining throughout the subarachnoid space bilaterally with no hydrocephalus.\n A hemorrhagic focus, cavernoma are likely;  metastatic or infectious lesion\n remains possible despite the lack of solid enhancement, however less likely.\n Attention on follow up can be considered.\n\n 3.  Extensive maxillary sinus and bil. mastoid air cell disease bilaterally\n with air-fluid levels as well as partial visualization of the post-surgical\n changes within the right face.\n\n                                                             (Over)\n\n [**3103-12-9**] 8:16 PM\n MR HEAD W & W/O CONTRAST; MRA BRAIN W/O CONTRAST                Clip # [**Clip Number (Radiology) 39687**]\n Reason: Please perform with MRI w/ contrast\n Admitting Diagnosis: ALTERED MENTAL STATUS\n  Contrast: MAGNEVIST Amt: 13\n ______________________________________________________________________________\n                                 FINAL REPORT\n (Cont)\n 4.  Patent major intracranial arteries without flow limiting stenosis,\n occlusion, aneurysm more than 3mm within the resolution of MRA.\n\n\n",
