      'FDG BRAIN                                                       Clip # [**Clip Number (Radiology) 39689**]\n Reason: CHRONIC GVHD HYPERINTENSITY VS. MASS ON MRI AND ALTERED MENTAL STATUS. EVAL FOR RIGHT TEMPORAL LESIONS\n ______________________________________________________________________________\n                                 FINAL REPORT\n\n RADIOPHARMACEUTICAL DATA:\n    10.4 mCi F-18 FDG ([**3103-12-14**]);\n HISTORY:  CML, chronic GVHD, and mass in the right temporo-parietal\n\n METHODS: Approximately 1 hour after intravenous administration of F-18\n fluorodeoxyglucose (FDG), noncontrast CT images were obtained for attenuation\n correction and for fusion with emission PET images. [The noncontrast CT images\n are not used to diagnose disease independently of the PET images.]  A series of\n overlapping emission PET images was then obtained. The fasting blood glucose\n level, measured by glucometer before injection of FDG, was 102 mg/dL. The area\n imaged spanned the vertex to the base of the skull.\n\n Computed tomography (CT) images were co-registered and fused with emission PET\n images to assist with the anatomic localization of tracer uptake.  The\n determination of the site of tracer uptake seen on PET data can have important\n implications regarding the significance of that uptake.\n\n INTERPRETATION:\n There is diffusely decreased FDG-uptake throughout the brain, of unknown\n etiology.  There is more focal decreased uptake of FDG in the right\n fronto-temporal lobe, corresponding to the region of hypoattenuation and\n calcification on CT, with no focal hypermetabolic areas within this region.\n\n FDG-avidity in the left forehead, just above the orbit, measures SUV 5.3 and\n corresponds to mild focal thickening of the soft tissues.\n\n IMPRESSION:  1. Diffusely decreased FDG activity within the brain with focal\n decreased FDG-avidity in the right fronto-temporal lobe, corresponding to the\n abnormalities on MR/CT, of uncertain cause.  Malignancy and acute encephalitis\n tend to be FDG-avid, while chronic encephalitis may be hypometabolic.   2.\n FDG-avidity in the left forehead, just above the orbit, corresponds to mild\n focal thickening of the soft tissues on CT and correlation with physical exam is\n recommended.\n\n\n         [**Name6 (MD) 2668**] [**Name8 (MD) 2669**], M.D.\n         [**Last Name (NamePattern5) 631**], M.D.              Approved: [**First Name8 (NamePattern2) 456**] [**3103-12-15**] 3:13 PM\n\n\n\n\n               RADLINE [**Telephone/Fax (1) 94**]; A radiology consult service.\n            To hear preliminary results, prior to transcription, call the\n                           Radiology Listen Line [**Telephone/Fax (1) 95**].\n\n',
