      "[**3104-1-6**] 3:28 PM\n TEMP DIALYSIS LINE PLCT                                         Clip # [**Clip Number (Radiology) 39698**]\n Reason: please place for temporary HD.\n Admitting Diagnosis: ALTERED MENTAL STATUS\n ********************************* CPT Codes ********************************\n * [**Numeric Identifier 3**] NON-TUNNELED                    [**Numeric Identifier 29**] FLUORO GUID PLCT/REPLCT/REMOVE   *\n * [**Numeric Identifier 270**] US GUID FOR VAS. ACCESS         [**Numeric Identifier 762**] MOD SEDATION, FIRST 30 MIN.      *\n ****************************************************************************\n ______________________________________________________________________________\n UNDERLYING MEDICAL CONDITION:\n  45 year old man needing HD.\n REASON FOR THIS EXAMINATION:\n  please place for temporary HD.\n ______________________________________________________________________________\n                                 FINAL REPORT\n INDICATION:  45-year-old male with acute renal failure needing hemodialysis.\n\n OPERATORS:  The procedure was performed by Dr. [**First Name8 (NamePattern2) 297**] [**Last Name (NamePattern1) 743**].  Dr. [**Last Name (STitle) 22**],\n the attending radiologist, reviewed the study.\n\n ANESTHESIA:  Moderate sedation was provided by administering divided doses of\n 25 mcg of fentanyl throughout the total intra-service time of 30 minutes\n during which the patient's hemodynamic parameters were continuously monitored.\n\n TECHNIQUE AND FINDINGS:  After the risks and benefits of the procedure were\n explained to the patient, written informed consent was obtained.  The patient\n was brought to the angiography suite and placed supine on the imaging table.\n The right neck was prepped and draped in usual sterile fashion.  A pre-\n procedure timeout and huddle were performed per standard [**Hospital1 10**] protocol.\n Fluoroscopy of the chest was obtained demonstrating a tracheostomy tube and\n nasogastric tube in standard positions.  Using sterile technique, and\n ultrasound guidance, a micropuncture needle was used to access the right\n internal jugular vein. Hard copy ultrasound images were obtained for the\n medical record.  A 0.018 wire was advanced through the needle into the SVC\n with fluoroscopic guidance. The needle was exchanged for a micropuncture\n sheath which was used to upsize the wire to [**Initials (NamePattern4) **] [**Last Name (NamePattern4) 7**] wire.  After appropriate\n measurements were made, the micropuncture sheath was removed and the tissues\n were dilated with soft tissue dilator.  Next, a 16 cm triple-lumen central\n venous catheter was advanced over the wire with its tip positioned in the\n distal SVC.  The wire was removed. Catheter was secured to the skin with 0\n silk suture, flushed and aspirated. Sterile dressings were applied.  The\n patient tolerated the procedure well without immediate complication.\n\n IMPRESSION:  Complicated placement of a double-lumen 16 cm temporary\n hemodialysis catheter with the tip positioned in the right atrium.  The\n catheter is ready to use.\n\n\n",
