      '[**3104-1-7**] 4:59 AM\n CHEST (PORTABLE AP)                                             Clip # [**Clip Number (Radiology) 39789**]\n Reason: please eval for interval change\n Admitting Diagnosis: ALTERED MENTAL STATUS\n ______________________________________________________________________________\n UNDERLYING MEDICAL CONDITION:\n  45 year old man with CML s/p SCT, chronic graft vs. host disease with\n  bronchiolitis obliterans, recently completed treatment for aspiration\n  pneumonia. Nasally intubated.\n REASON FOR THIS EXAMINATION:\n  please eval for interval change\n ______________________________________________________________________________\n                                 FINAL REPORT\n INDICATION:  45-year-old man with CML with bronchiolitis obliterans recently\n completed treatment for aspiration pneumonia.  Evaluate for interval change.\n\n COMPARISON:  Multiple priors, most recent portable AP chest radiograph\n [**3104-1-6**].\n\n TECHNIQUE:  Portable AP chest radiograph.\n\n FINDINGS:  Tracheostomy tube in standard placement.  Midline tip terminates in\n the lateral right subclavian vein.  Subclavian approach line projects below\n the cavoatrial junction.  Left-sided pleural effusion is unchanged. Right-\n sided pleural effusion appears worsened with low lung volumes bilaterally\n consistent with compressive atelectasis.  The cardiac, mediastinal and hilar\n contours appear unchanged.  Patient has developed mild pulmonary edema in the\n interim.  A rounded right sided perihilar opacity of uncertain significance is\n once again noted stable in appearance, size and position since [**3103-12-28**] and has no correlate on CT examination from [**3103-12-6**].\n\n IMPRESSION:\n 1.  Right pleural effusion appears worsened with bilateral lower lung volumes\n consistent with compression atelectasis.  Left pleural effusion is unchanged.\n 2.  Interval development of mild pulmonary edema.\n 3.  Stable perihilar structure with no correlate on CT examination from\n [**12-6**] warrants repeat CT for additional evaluation.\n Findings conveyed to Dr. [**Last Name (STitle) **] via the radiology communication dashboard.\n\n\n\n\n\n',
