      "[**3104-1-12**] 2:57 PM\n PERC G/G-J TUBE PLMT                                            Clip # [**Clip Number (Radiology) 39790**]\n Reason: please place perc G-tube. Pt with NGT. Needs long term feedi\n Admitting Diagnosis: ALTERED MENTAL STATUS\n ********************************* CPT Codes ********************************\n * [**Numeric Identifier 5742**] G TUBE PLACMENT, ALL INCL.                                             *\n *                                                                              *\n ****************************************************************************\n ______________________________________________________________________________\n UNDERLYING MEDICAL CONDITION:\n  45 year old man with h.o CML, severe GVHD of skin. Recent PNA. now s/p trach.\n  needs long term nutrition for rehab.\n REASON FOR THIS EXAMINATION:\n  please place perc G-tube. Pt with NGT. Needs long term feeding.\n ______________________________________________________________________________\n                                 FINAL REPORT\n MEDICAL HISTORY:  45-year-old man with history of CML and severe graft-versus-\n host disease.  The patient recently had aspiration pneumonia and now status\n post tracheostomy.  The patient has poor oral intake and needs longterm\n nutrition for rehab.  A percutaneous G-tube placement was requested.\n\n CLINICIANS:  Dr. [**First Name8 (NamePattern2) 3082**] [**Name (STitle) **] and Dr. [**First Name4 (NamePattern1) 765**] [**Last Name (NamePattern1) 22**].  Dr. [**Last Name (STitle) 22**] is the\n attending radiologist who was present and supervising throughout.\n\n ANESTHESIA:  Moderate sedation was provided by administering divided doses of\n 100 mcg of fentanyl and 1 mg of Versed throughout the total intraservice time\n of 30 minutes, during which the patient's hemodynamic parameters were\n continuously monitored.  Local anesthesia with 1% lidocaine.\n\n PROCEDURE AND FINDINGS:  An informed written consent was obtained after\n explaining the procedure, benefits, alternatives and risks involved.  The\n patient was brought to the angiography suite and placed supine on the imaging\n table.  The upper abdomen was prepped and draped in the usual sterile fashion.\n A preprocedure huddle and timeout were performed as per [**Hospital1 10**] protocol.\n\n Under ultrasound guidance, the left margin of the liver was marked on the\n skin.  The patient had an indwelling NG tube which was placed on the floor and\n this was used to insufflate the stomach with air.  Fluoroscopy was used to\n outline the stomach and transverse colon.  After identifying a safe window for\n G-tube placement, local anesthesia obtained with 1% lidocaine.  Under\n fluoroscopic guidance, three T-fasteners were inserted sequentially through\n the anterior abdominal wall into the stomach and tightened, elevating the\n stomach wall to the anterior abdominal wall.  A small skin incision was made\n between the T-fasteners and a 19-gauge needle was introduced into the stomach\n under fluoroscopic guidance.  The position of the needle was confirmed with\n small amount of contrast injection.  [**Initials (NamePattern4) **] [**Last Name (NamePattern4) 7**] wire was placed through the\n needle and needle removed.  The tract was dilated with a 12 French soft tissue\n dilator.  Then, a 12 French Wills-[**Doctor Last Name 10954**] gastrostomy tube was placed over the\n guidewire and guidewire removed.  Catheter loop was formed within the stomach\n and locked after confirming the position by contrast injection.  The tube was\n flushed and capped.  Catheter secured to skin with 0 silk sutures and a Flexi-\n Trak device.  Sterile dressings were applied.  The patient tolerated the\n procedure well and there were no immediate post-procedure complications.\n                                                             (Over)\n\n [**3104-1-12**] 2:57 PM\n PERC G/G-J TUBE PLMT                                            Clip # [**Clip Number (Radiology) 39790**]\n Reason: please place perc G-tube. Pt with NGT. Needs long term feedi\n Admitting Diagnosis: ALTERED MENTAL STATUS\n ______________________________________________________________________________\n                                 FINAL REPORT\n (Cont)\n\n IMPRESSION:  Successful placement of a percutaneous 12 French Wills-[**Doctor Last Name 10954**]\n gastrostomy catheter under ultrasound and fluoroscopic guidance.  The G-tube\n tip connected to gravity drainage overnight and can be used 24 hours post-\n procedure for feeding.\n\n\n\n",
