      '[**3104-1-13**] 3:29 AM\n CTA NECK W&W/OC & RECONS                                        Clip # [**Clip Number (Radiology) 40001**]\n Reason: please r/o tracheal innominate fistula\n Admitting Diagnosis: ALTERED MENTAL STATUS\n  Contrast: OPTIRAY Amt: 75\n ______________________________________________________________________________\n UNDERLYING MEDICAL CONDITION:\n  45 year old man with bleed at trachea between 2nd/3rd ring\n REASON FOR THIS EXAMINATION:\n  please r/o tracheal innominate fistula\n No contraindications for IV contrast\n ______________________________________________________________________________\n WET READ: PXDb WED [**3104-1-13**] 9:14 AM\n  There is no evidence of tracheal innominate fistula. Bilateral pleural\n  effusions and basilar atelectasis is present. Centrilobular emphysema is\n  present.\n ______________________________________________________________________________\n                                 FINAL REPORT\n CTA NECK WITH AND WITHOUT CONTRAST AND RECONSTRUCTIONS.\n\n HISTORY:  45-year-old male with tracheal hemorrhage between the second and\n third cartilaginous rings, to evaluate for a tracheal innominate fistula.\n\n TECHNIQUE:  Multiplanar CTA of the neck was performed with intravenous\n contrast administration.  Additional 3D reconstructed images were obtained.\n\n COMPARISON:  MR head, [**3103-12-12**] and CT head of [**3103-12-8**].\n\n FINDINGS:\n\n Limited images of the brain again demonstrate calcification and hypodensity\n within the right temporal and frontal lobes, unchanged and likely related to\n prior radiation.  The previously identified left temporal lobe lesion is not\n included on the current examination. There is no evidence of acute territorial\n infarction, mass effect, or acute hemorrhage. There has been near complete\n interval resolution of opacification of the left maxillary sinus and mucosal\n thickening involving the right maxillary sinus. There is mucosal thickening\n within the sphenoid sinuses. Fluid is noted within the mastoid air cells\n bilaterally.  There are subcutaneous surgical clips along the right zygoma and\n extending inferiorly.\n\n There are degenerative changes of the cervical spine. There is heterogeous\n bome marrow density with scattered sclerotic changes.\n\n There has been marked interval worsening of bilateral pleural effusions with\n compressive atelectasis and consolidations when compared with the prior CT\n chest of [**3103-12-6**].  There has been interval placement of a tracheostomy in\n adequate position.  There is no evidence of an endotracheal or paratracheal\n hemorrhage. There are good fat planes between the vascular structures and the\n tracheostomy tube without evidence of a tracheal innominate fistula. The\n thyroid gland is unremarkable. There is mild asymmetry of the soft tissues of\n the neck which may be secondary to radiation changes.\n\n                                                             (Over)\n\n [**3104-1-13**] 3:29 AM\n CTA NECK W&W/OC & RECONS                                        Clip # [**Clip Number (Radiology) 40001**]\n Reason: please r/o tracheal innominate fistula\n Admitting Diagnosis: ALTERED MENTAL STATUS\n  Contrast: OPTIRAY Amt: 75\n ______________________________________________________________________________\n                                 FINAL REPORT\n (Cont)\n The origins of the great vessels at the level of the aortic arch are\n unremarkable. There is dense atherosclerotic calcification at the origin and\n proximal V1 segment of the right vertebral artery without significant\n narrowing.  There is minimal atherosclerotic calcification of the origin of\n the left vertebral artery without narrowing. The common, internal, and\n external carotid arteries are patent without evidence of high-grade stenosis\n or occlusion.  The visualized intracranial arterial vasculature is normal in\n course and caliber without evidence of occlusion, high-grade stenosis,\n aneurysm greater than 3 mm, or arteriovenous malformation.\n\n IMPRESSION:\n 1.  No CTA evidence of a tracheal innominate fistula.\n 2.  Marked interval worsening of bilateral pleural effusions with compressive\n atelectasis and consolidations.\n 3.  No evidence of high-grade stenosis, occlusion, or dissection involving the\n extracranial arterial vasculature.\n 4.  Incomplete evaluation of the intracranial arterial vasculature\n demonstrates no evidence of high-grade stenosis, aneurysm, or arteriovenous\n malformation.\n 5.  Stable calcifications and hyperdensity in the right temporal and frontal\n lobes, likely representing prior radiation treatment.\n 6. Scattered sclerotic densities within the bone marrow likely secondary to\n metastases.\n\n\n',
