      "[**3104-1-26**] 12:10 PM\n TUNNELED DIALYSIS LINE PLACEME                                  Clip # [**Clip Number (Radiology) 40003**]\n Reason: pt is at rehab with temp dialysis line, needs tunneled doubl\n Type of Port: Power Port, double lumen\n ********************************* CPT Codes ********************************\n * [**Numeric Identifier 268**] TUNNELED W/O [**Numeric Identifier 269**] FLUORO GUID PLCT/REPLCT/REMOVE   *\n ****************************************************************************\n ______________________________________________________________________________\n UNDERLYING MEDICAL CONDITION:\n  45 year old man with CML/GVHD\n REASON FOR THIS EXAMINATION:\n  pt is at rehab with temp dialysis line, needs tunneled double dialysis line for\n  HD ?re-site due to length of time temp in and line being cared for at outside\n  facility thanks [**Doctor First Name 2913**]\n ______________________________________________________________________________\n                                 FINAL REPORT\n MEDICAL HISTORY:  45-year-old man with CML and severe graft versus host\n disease.  Patient is being dialyzed at rehab with a right IJ temporary\n dialysis line.  Patient is likely to need long-time dialysis and a request was\n placed for a tunneled hemodialysis catheter placement.\n\n CLINICIANS:  Dr. [**First Name8 (NamePattern2) 3082**] [**Name (STitle) **] and Dr. [**First Name4 (NamePattern1) 765**] [**Last Name (NamePattern1) 22**].  Dr. [**Last Name (STitle) 22**] is the\n attending radiologist who was present and supervising throughout.\n\n ANESTHESIA:  Moderate sedation was provided by administering divided doses of\n 100 mcg of fentanyl and 2 mg of Versed throughout the total intraservice time\n of 1 hour during which the patient's hemodynamic parameters were continuously\n monitored.  Local anesthesia with 1% lidocaine and 1% lidocaine with\n epinephrine.\n\n PROCEDURE AND FINDINGS:  An informed written consent was obtained from\n patient's wife who is his healthcare proxy after explaining the procedure,\n benefits, alternatives and risks involved.  Patient was brought to the\n angiographic suite and placed supine on the imaging table.  Right side of the\n neck and upper chest including the existing hemodialysis catheter were prepped\n and draped in the usual sterile fashion.  A preprocedure huddle and timeout\n were performed as per [**Hospital1 10**] protocol.\n\n An initial scout image was obtained demonstrating the existing temporary HD\n catheter in a satisfactory position.  Both the ports of the catheter were\n aspirated to get rid of heparin and then flushed with normal saline.  After\n taking appropriate measurements a subcutaneous tunnel was created from right\n upper chest to the venotomy site and a new 15-French x 19 cm tip-to-cuff HD\n catheter was pulled through.  An Amplatz super stiff guidewire was placed\n through the catheter and advanced into IVC under fluoroscopic control.  The\n catheter was removed over the guidewire and replaced with a peel-away sheath.\n The catheter was placed through the peel-away sheath after removing the\n guidewire and inner dilator.  The peel-away sheath was then removed.  Catheter\n secured to skin with 0-silk sutures and the access site in the neck closed\n with 4-0 subcuticular Vicryl sutures.  The tunnel was flushed with antibiotic\n solution and sterile dressings applied.  A fluoroscopic spot chest film was\n obtained demonstrating the catheter to be in a satisfactory position with the\n tip terminating in the right atrium.  Patient tolerated the procedure well and\n                                                             (Over)\n\n [**3104-1-26**] 12:10 PM\n TUNNELED DIALYSIS LINE PLACEME                                  Clip # [**Clip Number (Radiology) 40003**]\n Reason: pt is at rehab with temp dialysis line, needs tunneled doubl\n Type of Port: Power Port, double lumen\n ______________________________________________________________________________\n                                 FINAL REPORT\n (Cont)\n there were no immediate complications.\n\n IMPRESSION:\n Successful exchange of right IJ temporary HD catheter to a tunneled HD\n catheter.  The catheter was 15-French x 19 cm tip-to-cuff length with tip\n terminating in the right atrium.  The line is ready for use.\n\n\n\n",
