      "[**3104-1-26**] 12:11 PM\n PERC G/G-J TUBE PLMT                                            Clip # [**Clip Number (Radiology) 40004**]\n Reason: g-j tube placement\n  Contrast: OPTIRAY Amt: 25\n ********************************* CPT Codes ********************************\n * [**Numeric Identifier 38459**] CONVERT G TO GJ, ALL INCL.                                             *\n ****************************************************************************\n ______________________________________________________________________________\n UNDERLYING MEDICAL CONDITION:\n  feeding\n REASON FOR THIS EXAMINATION:\n  g-j tube placement\n ______________________________________________________________________________\n                                 FINAL REPORT\n MEDICAL HISTORY:  45-year-old man with CML and severe graft-versus-host\n disease.  Patient has IR-placed G-tube in place but is not able to tolerate\n feeds through the catheter in to stomach.  A request was placed for conversion\n of G- tube to a dual-lumen G-J tube.\n\n CLINICIANS:  Dr. [**First Name8 (NamePattern2) 3082**] [**Name (STitle) **] and Dr. [**First Name4 (NamePattern1) 765**] [**Last Name (NamePattern1) 22**].  Dr. [**Last Name (STitle) 22**] is the\n attending radiologist who was present and supervising throughout.\n\n ANESTHESIA:  Moderate sedation was provided by administering divided doses of\n 75 mcg of fentanyl and 1 mg of Versed throughout the total intra-service time\n of 65 minutes during which the patient's hemodynamic parameters were\n continuously monitored.  Local anesthesia with 1% lidocaine and lidocaine gel.\n\n PROCEDURE AND FINDINGS:  An informed written consent was obtained from\n patient's wife who is his healthcare proxy after explaining the procedure,\n benefits, alternatives and risks involved.  The patient was brought to the\n angiography suite and placed supine on the imaging table.  The upper abdomen\n including the existing G-tube were prepped and draped in the usual sterile\n fashion.  A pre-procedure huddle and timeout were performed as per [**Hospital1 10**]\n protocol.\n\n An initial scout image of the abdomen was obtained demonstrating the G-tube in\n satisfactory position, which was confirmed by contrast injection.  Then the\n catheter was cut distal to the hub releasing the locking mechanism.  A 0.035\n [**Last Name (un) 414**] wire was placed through the catheter into the stomach and the catheter\n removed.  A 7 French x 11 cm vascular sheath was placed over the guidewire.  A\n second wire, 0.035 angled Glidewire was placed through the sheath and sheath\n replaced over the Glidewire using the [**Last Name (un) 414**] wire as a safety wire.  Through\n the sheath a Kumpe catheter was placed and using the combination of Kumpe\n catheter and Glidewire, the wire was advanced into proximal jejunum.  Then the\n Glidewire was removed and replaced with guidewire from MIC G/J tube set.  Then\n both the Kumpe catheter and vascular sheath were removed.  A peel-away sheath\n was placed over the guidewire and inner dilator removed.  A 16 French MIC G-J\n tube was placed over the guidewire, through the peel-away sheath and advanced\n into jejunum.  The peel-away sheath was removed.  The balloon was inflated\n with 16 cc of saline mixed with contrast and the plastic disc approximated to\n the abdominal wall.  The position of the catheter confirmed by contrast\n injection. The plastic disc was secured to the skin with 0 silk sutures.\n Sterile dressings were applied.  The patient tolerated the procedure well and\n                                                             (Over)\n\n [**3104-1-26**] 12:11 PM\n PERC G/G-J TUBE PLMT                                            Clip # [**Clip Number (Radiology) 40004**]\n Reason: g-j tube placement\n  Contrast: OPTIRAY Amt: 25\n ______________________________________________________________________________\n                                 FINAL REPORT\n (Cont)\n there were no immediate complications.\n\n IMPRESSION:  Successful conversion from G-tube to G-J tube, placing a 16\n French MIC G-J feeding tube.  Catheter is ready for use.\n\n\n\n\n",
