      'CCU Progress Note:\n\nS- "Can I get up yet?"\n\nO- see flowsheet for all objective data.\n\ncv- To cath lab this am for pericardialcentesis- 540cc serosang fluid removed- pericardial drain placed- no stopcock noted from drain to drainage bag- draining large amt sero-sang fluid- (550cc in bag @ present)- unable to flush- fellow aware- arterial & venous sheaths D/C\'d @ 1300 from R groin- small amt of sero-sang fluid noted on dsg, but no hematoma- initial ABP 153-169/90-91- med with fentanyl for  comfort with effect- Once Pt comfortable, B/P 119-126/81-85 MAPs 91-93\nTele: SR- ST no ectopy- HR 93-110- Hct 27.9 this am- repeat 27- K 6.4 but labs hemolyzed- repeat 3.8- Mg 2.3\n\nresp- In O2 4L via NC- ABG 7.42-41-139-28-995- lung sounds with bibasilar crackles- tachypnea present- RR 24-34- Spo2 94-100%.\n\nneuro- anxious- A&O X3- moving all extremities- cooperative for the most part, but can be demanding- follows command.\n\ngi- abd softly distended- (+) bowel sounds- taking Po fluids without incident- will advance diet when Pt able to bend- no BM.\n\ngu- unable to void lying down post procedure- Pt straight cath for 650cc @ 1700.\n\ncomfort- fentanyl given initially for c/o pericardial drain site pain- morphine 2mg IV & oxycodone 5mg Po given with good effect.\n\nId- con\'t on droplet precautions- afebrile- WBC 4.2\n\nA- successful pericardialcentesis with placement of pericardial drain.\n\nP- fellow to change pericardial bag & place stopcock on tubing for routine flushes- monitor hemodynamics- med for comfort- follow temps-\noffer emotional support to Pt & family- keep them updated on plan of care.\n\n',
