      'CCU Nursing note\nS-"I have to stay in the ICU just for this?"\nO-see flowsheetand admit note for additional details.\n\n42y.o male admitted c c/o SOB x2 days. Currently on Tamiflu for influenza A. PMHx significant for CML. Last bone marrow transplant [**3095**] c chronic graft vs host disease of skin and liver. Also diagnosed c catheter associated R Subclavian acute DVT ([**3101-1-10**]) for which he was prescribed Lovenox. Compliant up until 3 days ago at which time he self d/c\'d. Now c pericardial effusion, pulsus [**7-12**]. Scheduled for pericardial drain this am first case.\n\n\n\nN-a/ox3, MAE. denies pain. no focal deficits.\n\nCV-NSR to ST 86-110. NBP 107-130 c MAP wnl. Pulsus [**7-12**]. 1 PIV. Will place additional this am. Echo done 2300-no tamponade @ this time, however fluid accumulation will require pericardial drain (to be placed this am first case).  Admit Hct 29.3 (chronic anemia). F/U am labs. IVF: 100cc/hour NS for 1L.\n\nResp-Apices clear, crackles in bases. 3L O2 c sats 97-100%. Currently denies SOB.\n\nGI-no BM this shift. NPO since midnight.\nGU-voiding adequate amts. urine cx sent.\n\nID-afebrile. Droplet percautions for Influenza A.\n\nSkin-Chronic graft vs host disease of the skin. All pressure areas intact. Pt turns self.\n\nplan-pericardial drain. Pt and wife updated on [**Name (NI) 633**] and consented for procedure. f/u am labs. continue to check pulsus.\n\n\n\n\n',
