      'Nursing Note: [**2993**]-0700 pt full code, droplet precs r/t flu.\n\nNeuro: pt [**Name (NI) 227**]3, sleeping confortably during night. ambulates to commode with assistance r/t hypoxia and tachypnea during exertion. pt denies pain. teaching r/t using call light before ambulating, safety, incentive spirometry done. pt stated that he is "sick of being attached to monitor and not being able to get up on his own." administered 2mg IV ativan prn prior to bipap.\n\nResp: tolerated two hours on bipap 5/8 from 2100-2300. otherwise sats 98-100 on 4L NC. RR 25-40 shallow breathing pattern continues. lungs coarse and diminished, dyspnec at rest and worsens with exertion, RN and RRT instructed pt on benefits and bipap and spirometer. congested productive cough noted, unable to bring up sputum. scant nosebleed noted overnight.\n\nCV: NBP (thigh) 150-160/60-70, pt refuses to wear cuff for automatic BP, spot checks done. HR 60-80 SR, occ PAC\'s noted. afebrile tmax 96.9.  pos distal pulses. tolerating metoprolol and diltiazem. refuses SC heparin and pneumo-boots.\n\nGI: pt has fair appetite, ate majority of dinner with assistance from wife. pos bowel sounds, loose brown BMx1 overnight.\n\nGU: pt voids in urinal appropriatly, UO adequate, clear yellow, see careview.\n\nID: pt + influenza, continues on tamiflu. ABX: azythromycin, vanco, zosyn.\n\nSkin: no active skin breakdown noted, pts skin sesitive r/t GVHD. pts wife assists him with bathing and applying skin creams.\n\nIV: left brachial PICC WNL.\n\nSocial: pts wife at pts bedside overnight, sleeping in room. assists pt with ADL\'s and relieving pt anxiety. I did reinforce importance of pt/wife using call light to notify when pt needs to ambulate to commode. explained that safety is our major concern and the risk for falls r/t cables. stated understanding but continued reinforcement needed.\n\nPlan: continue to monitor pts resp status, using NIV periodically for rest from WOB. monitor vitals, labs. cont reinforcement of ICU safety policy and importance of notifying RN. assessment ongoing.\n\n\n\n\n\n\n',
