      "See initail and readmission data, MD notes/orders.\nEvents: 42 year old male patient trasfered from 7Feldberg for increasing 02 requirement with hx of current flu, CML/BMT 05,GVH affecting skin,liver and lungs who was admitted to [**Hospital1 3**] on [**3101-1-27**] with SOB and Right upper extremity DVD. He arrived to ICU this pm on 100% NRBM with 02 sat of 100%. He is mildly tachypnic at baseline, lungs with bronchial breath sounds in all fields. RA sat 88% VBG obtained, see flow sheet. Plan is to premedicate with sodium bicarb gtt and send for CTA to R/O pulmonary emboli. Despite pts 02 requirements he continues to be active in room with long recovery period noted after activity. refusing pnuemo boots and subcutaneous heparin and stating he will do calf pumps and move legs instead. #20SL placed in left lower arm, below double lumen pic line on same side. IV required for IV contrast for CTA and will be removed post procedure. Wife is at bedside and very supportive. Pt is alert and oriented x3, denies pain and answers questions appropriately. SR noted on monitor with hr in 70's and bp 145/75. Pt is voiding in urinal with 300cc out since arrival. Skin surfaces grossly intact with 4+peripheral pulses. Pt and wife aware of and agreeable to plan of care.\n\n\n",
