      'Nursing Note: [**2993**]-0700  droplet prec, full code\n\nNeuro/activity: pt [**Name (NI) 227**]3, sleeping intermittently during night, denies any pain, pt appears frustrated, weak when standing up especially r/t resp status, difficult time catching breath, instructed pt that using urinal in bed and that using bedpan would expend less energy, pt demanded to be allowed to stand to void and use bedside commode, ambulates to commode with assistance, pt reports no dizziness or lightheadedness with ambulation.\n\nResp: pt currently on 100% NRB mask, sats 97-100. weaned down to 4 L NC for several hours but sats dropped to 87-90 and RR 30-40 when ambulating. tachypnic RR 25-40, becomes very tachypnic during minimal activity and requires prolonged recovery time following activity, productive cough, sm tan sputum up and sent to lab. lungs coarse and diminished bilaterally. CT of chest done overnight to r/o PE (NEG).\n\nCV: HR 80-95 SR w/ occ PVC\'s, received ordered PO lopressor and cardizem, NBP (calf) 160-190/80\'s. pos distal pulses. afebrile, pt "feels cold" during night.\n\nGI: pt has house diet ordered, takes PO well, ate some of dinner, loose brown BM x3 via commode. pos bowel sounds.\n\nGU: pt voids, UO adequate,\n\nIV: left DL PICC WNL, receving sodium bicarb drip at 200/hr for 6 hours post CT scan w/ contrast.\n\nSkin: pts skin appears intact, no breakdown noted. skin color pale.\n\nSocial: pts wife very involved w/ pts care, at pts bedside during night, pts wife sleeping in pts bed during night and RN instructed pts wife that it was not allowed per ICU policy and infection control reasons. encouraged wife to stay in family room overnight. at bedside at present. provided information to pt/wife about plan of care.\n\nPlan: continue to monitor pts resp status closely, attempt to wean 02. encourage limiting activity, monitor vitals, labs. cont to provide information on [**Name (NI) 633**] to pt. asssessment ongoing.\n\n\n\n\n\n\n\n\n',
