      'MICU EAST NPN 0700-[**2993**]\n\n\nPlease see flowsheet for further details..\n\n\nA&O x3. Somewhat withdrawn. Asked for ativan x1 after a coughing spell and received 2mg with gd effect and pt slept for a few hours.\n\nOn 4L N/C in bed but requires addition of 100% NR with any activity. Easily desats to 80s. OOB-commode. This afternoon when on the commode his O2sats stayed in the 90s. He stated he felt just as bad however as when he was on the commode in am (when O2sats were in the 80s). Continues to insist on getting OOB to void and use commode and refuses sq heparin and pneumo boots. Otherwise cooperative with care.\n\nPO intact fair-poor probably r/t his dyspnea. Passed 2 loose,brown stools OB+.\n\nUO adequate.\n\nAfebrile. Received IVIG this afternoon and tol well w/pre-medication of tylenol and benadryl. + influenza in sputum.\n\nWife currently at bedside.\n\nPlan to continue current mgmt and monitor.\n\n\n',
