      "MICU NPN 0700-[**2993**]\n\n\nPlease see flowsheet for further details..\n\nA&O. Denies pain.\n\nContinues to desat w/exertion. This a.m. his O2sats went to 80s when first placed on 5L N/C. He tolerated N/C better this afternoon but remained on NRB for most of the day. After extertion his O2sats would come up fairly easily but he would continue to feel SOB. He stated he is now getting more SOB when turning in bed. He received 2mg IV Ativan after a coughing spell and was able to sleep for a few hours w/ N/C on at 5L and O2sats of 96%. Wife in all day and plans to stay the night. She is a great support for patient.\n\nAfebrile though on steroids. No antibiotic changes. No IVIG given today.\n\nLess hypertensive today though occ episodes after exertion.\n\nApetite good. Pt stated his breathing doesn't feel any worse after eating.\n\nAs above, wife staying the night. Plan to continue to monitor and offer support. Suggest Ativan tonight to help him sleep.\n\n",
