      'NURSING NOTE\nPLEASE SEE CAREVUE FOR DETAILS\nPT S/P [**8-9**] RIGHT THIGH-RIGHT FACE FLAP. INTUBATED OVERNOC IN PACU. TRANSFERRED TO SICU FOR HRLY FLAP CHECKS, EVENTUAL EXTUBATION. PER PLASTICS PT IS TO NOT BE MOVED UNLESS ABSOLUTELY NECESSARY, INCLUDING TURNING FOR SKIN CHECKS OR BED CHANGES. NO ORAL CARE/MANIPULATION WHAT-SO-EVER INCLUDING ORAL TEMPS OR SUCTIONING.\n\nNEURO: PT TO REMAIN SEDATED PER PLASTIC SURGERY TEAM UNTIL FACIAL SWELLING DOWN/READY TO WEAN. PROPOFOL AT 70MCG/KG/MIN FOR SEDATION. PT WAKING UP THIS EVE, MOVING RUE, COUGHING/BUCKING VENT, FENTANYL INCREASED TO 75MCK/KG/MIN W/ACHIEVED LEVEL OF COMFORT/SEDATION.\n\nCVS: HR 57-70S, SB/NSR, SBP 90S-130S, 2.5MG LOPRESSOR GIVEN. HYPOTHERMIC MOST OF SHIFT, BEAR-HUGGER ON, PRESENTLY 98.3 AX\n\nRESP: CMV 550X12/40%/5, OVERBREATHING AT TIMES. 02 SATS 99-100%, LUNGS CLEAR TO APICES, DIMINISHED AT BASES. NO ETT SXNG UNLESS ABSOLUTELY NEEDED PER PLASTICS.\n\nGI/GU: ABD SOFT, BS ABSENT, NO BM, NPO. NGT TO LWS W/MOD AMT GREEN LQUID DRNG. HUO 15-80CC, PT CAN HAVE GENTLE DIURESIS FOR LOW U/O PER PLASTICS.\n\nINTEG: RIGHT FACIAL FLAP W/SUTURED BORDER W/SM-MOD AMT SEROSANG DRNG. RIGHT EYE SUTURED SHUT, DRNG SM AMT SEROSANG DRNG. JP CHEEK & NECK W/SM AMT SEROSANG DRNG. LEFT THIGH GRAFT SITE COVERED W/XEROFORM DRNG LGE AMTS SANGUINOUS. RIGHT THIGH GRAFT SITE COVERED W/VAC DSG, DRNG SM-MOD AMT SEROUS-SEROSANG DRNG.\n\nSOCIAL: PT WIFE IN TO VISIT\n\nPLAN: CONT HRLY FACIAL FLAP CHECKS, HEMODYNAMIC MONITORING. PROPOFOL/FENTANYL DRIPS FOR PT SEDATION, [**Name (NI) 7629**]/DRAIN CARE. MIN PT [**Name (NI) 6265**]/MANIPULATION OF DRAINS AND PT IN GENERAL PER PLASTICS. FAMILY SUPPORT. PLAN FOR GENTLE WEAN TO EXTUBATE IN NEAR FUTURE.\n\n',
