      "bronchoscopy\n38 year old man with cml admitted to the micu for a bronchoscopy.\n\nprior to the procedure pt's bp was 122/62 with a pulse of 101 st, occasional pvcs, resp rate of 22.  prior to the actual procedure pt rec'd hurricane spray and lido spray.  for the whole procedure pt rec'd a total of 3mg of versed and 100mcg of fentanyl and did extremely well.\n\nresp:  pt was placed on 4l nasal prongs for the procedure but the o2 was increased to 9 liters np when o2 sats dropped to 89%. resp rate was 22-24.  pt was lavaged and washings were obtained via the bronch.\n\ncardiac:  during and post the procedure pt's bp was 114-124/58-80 with a pulse of 98-108 sr/st, with frquent unifocal pvcs---k+ was 4.1.\n\nneuro:  pt awoke promptly at the end of the procedure and at present is alert and oriented.  initiating conversation.  wife is with pt.\n\nskin: red \"hive-Like\" blotchy areas noted on chest, face, neck and arms.\n\n",
