      'CCU Nursing note\nS-"This is crazy....why do you have to do that."\nO-see flowhsheet for additional details.\n\nN-a/ox3, mae, anxious, can be demanding. Requires frequent explanation of care for compliance. Bedrest. IV morhpine 4mgx2 as well as oxycodone 10mg HS for back pain c desired effect.\n\nCV-tele monitored in NSR to ST 96-106 c rare PVC. NBP 112-128. No pulsus detected. Pericardial drain site wnl. Approx. 25cc straw colored drainage currently in bag (changed [**1-28**]). Checked Q4 according to protocol as aspirate <5cc-drain patent. Right groin site wnl-scant amt serosang drainage on dsg-no hemotoma. Bilateral pedal pulses palpable. 2 pivs. Hct stable. Sub-q heprin. known catheter associated  DVT right subclavian-no BP or blood draws in right arm. To have US done.\n\nResp-O2 @ 5L NC. sats 97-100%. LS clear c crackles in bases. Becomes tachypnic c activity-frequently reminded to allow staff to assist pt c turning in bed.\n\nGi-last BM [**1-27**]. Good appettite/po intake. +BS.\nGU-difficulty voiding w/o adhering to activity restricitions-pt demanding to get OOB. 14 french Foley placed for urinary retention. adequate UO.\n\nID-Tmax 98.7. WBC 4.2. Droplet percautions as positive for A influenza-on tamiflu, Levaquin.\n\nsocial/dispo-Wife stayed overnight c pt for emotional support. Full code.\n\na/p-42y.o male c PMHx significant for CML c gvh disease of skin, liver. Admitted c SOB, CT/echo revealed Pericardial effusion. s/p pericardial drain placement [**1-28**] c 550cc out. Current output as mentioned above. Continue to monitor drain per ptotocol. f/u am labs. update pt on [**Month/Year (2) 633**].\n\n\n',
