      "MICU NPN 11AM-7PM:\nNeuro: Pt awake and alert, very discouraged and upset he is so weak and irritated by the fact he has to take so many meds. I went in to give him his noon meds and his 8AM meds were waiting to be taken. Some of them were on the floor and some were mixed in the sheets. I discussed with him the importance of taking his meds on time. He told me he was too tired and SOB to eat and needs to eat in order to take his pills. Team in to discuss these things on rounds and will adjust cardiac meds to extended release formulas to decrease frequency of meds. Team also recommends using bi-pap intermittently throughout the day to let pt rest so he can eat his meals. This did work when tried today. Pt able to eat lunch after he rested on bi-pap 1330-1500. Pt using call bell at times. Unsteady on his feet and needs assist to commode. Denied pain but has extreme skin sensitivity due to GVH disease of skin. A+O times three.\n\nCV: Remains slightly hypertensive on metoptolol and diltiazem PO. BP 140-170's. HR 60-80 NSR. Refusing sc heparin becasue he says he is moving around enough in the bed and the room. Frequent nose bleeds noted.\n\nResp: Pt on 4L N/C and is dyspneic at rest which increases with exertion. Looks poor at times. Congested productive cough noted, sputum frothy white. Rested on bi-pap for 90 minutes today. Lungs coarse with deminished breath sounds at bases bilaterally.\n\nGI: Poor appetite. Pt said he had diarrhea stool this AM before I came in.\n\nGU: VOids clear yellow urine in urinal without difficulty.\n\nID: afebrile on vanco/zosyn as well as two flu meds, tamiflu and amantidine. Remains on droplet precautions for influenza A.\n\nSocial: I spoke to pt's wife who will be back at 1800 to stay again for the night. She is concerned that he is watched closely and that his light is answered quickly because he tends to get up on his own if light is not answered quickly. This is why she stays with him at night.\n\nIV: L PICC in place and works well. Both ports are accessed with KVO.\n\n\n\n\n\n",
