      'NPN 7AM-7 PM\n\ns: " when is this catheter coming out?!"\n\no: Please see careview for vitals and other objective data\n\nPt with PMH of CML, bone marrow transplant in [**3095**], has Graft VS host disease skin, liver, and chronic throbocytopenia. Pt also has chronic right subclavian stenosis with colateral flow. Came to CCU after being SOB at home with ambulation, also + for Influenza. AT cath lab pericardial drain was placed and drained 500 cc. Drainage stopped overnight, Q4 hour flush and aspirate, less than 1 cc last two attempts.\nToday pt was coughing around 1 PM and pt developed rapid A FIB, ventricular response  160-180. Lopressor 5 MG x 2 dosess and rate down to 110-120\'s ( but up to 130 with activity). Pt also experienced\nsevere activity intolerance, when turned desaturates to 88, We had weaned o2 off, and o2 is fine at rest but not with any activity. Pt now on 4L nc sat 96-98 percent. His BP was ok with rapid AF, but did become SOB and co palpitations when rate was 165-180.\n\nNeuro- alert, OX3.\n\nCV- was in SR now AFIB. Pt tolerates rhythm and is on IV lopressor.\nmay start cardizem if lopressor not decreaseing HR . Pulsus [**3-8**]\nat noon.\n\nRespiratory: As above, on 4L NC, lungs sound diminished at bases,\ncoughing and expectorating clearish secreations. Has the Flu.\nAfebrile, due to his imunosurpression.\n\nGI/GU- eating and drinking, has foley catheter for urinary retention\nwhen pt is off bedrest he would like it removed.  urine output\nover one liter today. creat 1.1,  K 5.1 ( drawn from IV).\n\nA: pt with Pericarditis, Complicated by arrythmias, ( ? secondary to\ncatheter position) now in Afib and drain may be removed as pt is\nhavbing a repeat echo and draining less. pt also has Influenza and is on droplet precautions.\n\nP: Continue to monitor CV, resp status, arrythmias, Pulsus, support pt and family.\n\n',
